  true,\n\t\"url\": null,\n\t\"notes\": \"<p>In 1992, Congress enacted the Fertility
  Clinic Success Rate and Certification Act (FCSRCA). The act requires CDC to collect
  \ data from clinics and submit an annual report to Congress on Assisted Reproductive
  Technology (ART) success rates. In 1996, CDC initiated the ART Surveillance System
  to collect cycle specific and clinic specific data from all medical clinics practicing
  ART in the United States and its territories.  The data collected include patient's
  diagnosis, type of ART,  clinical information pertaining to the ART procedure, and
  information on pregnancy outcomes.</p>n\",\n\t\"license_title\": \"Other License
